// import logo from './logo.svg';
import './App.css';

class Car { 
  constructor(name) {
    this.brand = name;
  }
  getcar() {
    return this.brand
  }
};
mycar = new Car('Chevy')
App = () => {
  const element = (
  <div>
    <h1>Hello!</h1>
    <h2>Good to see you here.</h2>
  </div>
);
  return (
    <div className="App">
      <header className="App-header">
        {element}, {mycar.getcar()}
      </header>
    </div>
  );
}

export default App;
